import * as React from 'react';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { StyleSheet, Image } from 'react-native';
import { Text, View } from '../components/Themed';
import { useNavigation } from '@react-navigation/native';
import axios from 'axios';

export default function TabOneScreen() {
  const [artists, setArtists] = React.useState<any | object>({})

  React.useEffect(() => {
    // const result = await axios();
    axios.get('https://tenderfy.herokuapp.com/artists')
    .then(res => {
      // console.log(res.data["0"]["artists"])
      setArtists(res.data)
    })
  }, [])

  if(Object.keys(artists).length > 0) {
    console.log(artists["0"]["artists"])
  }

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Tab One</Text>
      <View style={styles.innerContainer}>
        {Object.keys(artists).map((artist, key) => (
          console.log(artists[artist]["images"]),
          <View>
            <Text key={key} style={styles.innerContainer}>{key + 1}: {artists[artist]["name"]}</Text>
            <Image
             style={styles.image}
              source={artists[artist]["images"]}
            />
          </View>
        ))}
      </View>
      <View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    width: 100,
    height: 50
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  innerContainer: {
    flex: 1,
    flexDirection: 'column'
    // justifyContent: 'flex-start',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
